class Solution:
    def lengthOfLongestSubstring(self, s):
        max_length = 1 if len(s) > 0 else 0
        i, j = 0, 1
        while i < len(s):
            while j < len(s):
                if s[j] in s[i:j]:
                    i = s.rindex(s[j], i, j)
                    break
                max_length = max(j - i + 1, max_length)
                j += 1
            i += 1
        return max_length


